import React from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';
import download from '../../../img/download.jpg';
import { deleteVehicleBySubAdmin } from '../../../actions/Sub-Admin/vehicleProfile';
import { connect } from 'react-redux';

const VehicleItem = ({
  deleteVehicleBySubAdmin,
  profile: { _id, type, manufacturer, model, transmission, available }
}) => {
  var avail = 'Available';
  if (!available) {
    avail = 'Booked';
  }
  var id = _id;
  return (
    <div className='profile bg-light'>
      <img src={download} alt='' className='round-img' />
      <div>
        <h2>{type}</h2>
        <p>
          {manufacturer} {model && <span> {model} </span>}{' '}
        </p>
        <p>{transmission}</p>
        <Link to={`/VehicleById/${_id}`} className='btn btn-primary'>
          View Vehicle
        </Link>
        <button
          onClick={() => deleteVehicleBySubAdmin(id)}
          className='btn btn-danger'
        >
          Delete
        </button>
      </div>
      <ul>
        <li className='text-primary'>
          <i className='fas fa-address-book'></i>{' '}
          {avail && <span>{'Availaibility'}</span>}{' '}
        </li>
        <li className='text-primary'>
          <i className='fas fa-check'></i> {avail && <span>{avail}</span>}{' '}
        </li>
      </ul>
    </div>
  );
};

VehicleItem.propTypes = {
  profile: PropTypes.object.isRequired,
  deleteVehicleBySubAdmin: PropTypes.func.isRequired
};

export default connect(deleteVehicleBySubAdmin)(VehicleItem);
